require 'minitest/autorun'
require_relative 'alchemical_reduction'

class ReposeRecordTest < Minitest::Test
  def test_small_polymer
    polymers = "dabAcCaCBAcCcaDA"

    assert_equal 10, alchemical_reduction(polymers)
  end

  def test_casing
    assert_equal casing("a"), :lower
    assert_equal casing("A"), :upper
  end

  def test_should_remove
    assert should_remove("a", "A")
    assert should_remove("A", "a")
    assert !should_remove("a", "a")
    assert !should_remove("A", "A")
    assert !should_remove("a", "B")
    assert !should_remove("a", "b")
  end

  def test_remove
    polymers = "dabAcCaCBAcCcaDA"
    assert_equal 6, with_removal("a", polymers)
    assert_equal 8, with_removal("b", polymers)
    assert_equal 4, with_removal("c", polymers)
    assert_equal 6, with_removal("d", polymers)
  end

  def test_best_removal
    polymers = "dabAcCaCBAcCcaDA"
    assert_equal ["c", 4], best_removal(polymers)
  end
end

